import React from "react";

import "./CodeLanguajes.css";

import reactJS from "../../images/reactJS.png";
import html5 from "../../images/html5.png";
import css from "../../images/css.png";
import js from "../../images/js.png";
import mongo from "../../images/mongo.png";
import github from "../../images/github.png";
import git from "../../images/git.png";
import angular from "../..//images/angular.png";

const CodeLanguajes = () => {
  return (
    <div className="codelanguajes col-12 col-md-6">
      <div className="d-flex flex-row">
        <img className="codelanguajeslogo" src={reactJS} alt="reactJs" />
        <img className="codelanguajeslogo" src={html5} alt="reactJs" />
        <img className="codelanguajeslogo" src={css} alt="reactJs" />
        <img className="codelanguajeslogo" src={js} alt="reactJs" />
        <img className="codelanguajeslogo" src={mongo} alt="reactJs" />
        <img className="codelanguajeslogo" src={github} alt="reactJs" />
        <img className="codelanguajeslogo" src={git} alt="reactJs" />
        <img className="codelanguajeslogo" src={angular} alt="reactJs" />
      </div>
    </div>
  );
};

export default CodeLanguajes;
